import React,{Component} from "react";
import NavBar from "./NavBar";

class Home extends Component{
    render(){
        return(
            <div className="container-fluid">
                <div className="row">
                    <div className="col-lg-6 text-left">
                        <h1>Opinion hai?</h1>
                        <h1>Trade karo</h1>
                        <span>Get rewarded for giving opinions</span>
                    </div>
                </div>
            </div>
        );
    }
}

export default Home;
